- input: "TEXT\x1CC00430694\x1C.TEXT\x1C\x1CF3PA\x1CWe recently requested that the
    Brownback For President Committee BFP be reopened for the purpose of paying an
    outstanding debt to Martin Gillespie, a former member of the BFP staff. Because
    of the size of the obligation, and out of an abundance of caution, we determined
    that reopening the campaign account would be prudent, as it would ensure that
    the transactions would become a part of the public record. The debt payment to
    Mr. Gillespie on this report was for out-of-pocket expenses that he incured over
    the course of the closing months of the campaign. Unfortunately there was a misunderstanding
    about paying the bill when it arrived and we inadvertently overlooked the debt
    on later reports. When Mr. Gillespie returned to the organization after our Termination
    Report had been accepted by the Commission and informed the campaign of the oversight
    along with an additional request for funds, we confirmed that the obligation was
    legitimate and began the process of figuring out how best to pay him. After consultation
    with legal counsel, we asked that the account be re-opened, received a loan from
    Senator Brownback, paid Mr. Gillespie for all outstanding reimbursements with
    interest. In the coming months, we will attempt to raise funds to pay down the
    campaign's loan from the Senator. We are in the process of filing all reports
    for 2008. T.C. Anderson, Treasurer\n"
